  useEffect(() => {
    getData()
  }, [])
  const getData = async () => {
      const response = await fetchData()
      setData(response)
  }
  return (
    <>
    {data?.map((res)=>{
    return(
      <h1>{res.title}</h1>
    )
   })}
    </>
  )
}

